import Navbar from '../components/navbar';

const Landing = () => {
  return (
    <div className="min-h-screen bg-gray-50">
      <Navbar />
      <div className="flex flex-col justify-center items-center mt-20 px-4">
        <h2 className="text-3xl font-bold text-gray-800 mb-4">Unlock Your Career Potential</h2>
        <p className="text-gray-600 mb-10 text-center max-w-lg">
          Upload your resume to find your ATS score and discover job roles best suited for you.
        </p>
        <a
          href="/login"
          className="bg-blue-600 text-white px-6 py-3 rounded hover:bg-blue-700 transition"
        >
          Get Started
        </a>
      </div>
    </div>
  );
};

export default Landing;
